package p2279

import (
	"testing"
)

func Test_maximumBags(t *testing.T) {
	type args struct {
		capacity        []int
		rocks           []int
		additionalRocks int
	}
	tests := []struct {
		name string
		args args
		want int
	}{
		{
			name: "Example 1",
			args: args{
				capacity:        []int{2, 3, 4, 5},
				rocks:           []int{1, 2, 4, 4},
				additionalRocks: 2,
			},
			want: 3,
		},
		{
			name: "Example 2",
			args: args{
				capacity:        []int{10, 2, 2},
				rocks:           []int{2, 2, 0},
				additionalRocks: 100,
			},
			want: 3,
		},
		{
			name: "WA 1",
			args: args{
				capacity:        []int{91, 54, 63, 99, 24, 45, 78},
				rocks:           []int{35, 32, 45, 98, 6, 1, 25},
				additionalRocks: 17,
			},
			want: 1,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := maximumBags(tt.args.capacity, tt.args.rocks, tt.args.additionalRocks); got != tt.want {
				t.Errorf("maximumBags() = %v, want %v", got, tt.want)
			}
		})
	}
}

func BenchmarkHeapSmallCnt(b *testing.B) {
	var (
		capacity        = []int{91, 54, 63, 99, 24, 45, 78}
		rocks           = []int{35, 32, 45, 98, 6, 1, 25}
		additionalRocks = 17
	)
	for i := 0; i < b.N; i++ {
		maximumBagsHeap(capacity, rocks, additionalRocks)
	}
}

